import React, { Component } from "react";

class Header extends Component {
  state = {
    count: 0,
  };
  render() {
    var num = this.state.count;
    return (
      <div>
        <span>{this.num}</span>
        <h1>Hello World</h1>
        <button class="btn btn-primary" onChange="this.formatCount()">
          Increment
        </button>
      </div>
    );
  }

  formatCount() {
    return (this.num = this.num + 1);
  }
}

export default Header;
